import React, { Component } from 'react';

import style from './List.module.css';
import images from '/continent.jpg';

const Hotel = [
    {
        category: 'Apartment',
        city: 'Rome',
        name: 'Pettinatori Campo de FIORI',
        star: '****',
        image: 'continent'
    },
    {
        category: 'Apartment',
        city: 'Minsk',
        name: 'Minsk Belarus Studio in historical center',
        star: '****',
    },
    {
        category: 'Cottage',
        city: 'Governador Celso Ramos',
        name: 'Exceptional property private beach',
        star: '*****',
    },
    {
        category: 'Room',
        city: 'Marrakesh',
        name: 'The cozy Palace',
        star: '****',
    },
    {
        category: 'Treehouse',
        city: 'Volcano',
        name: 'Treehouse at Kilauea Volcano',
        star: '**',
    },
    {
        category: 'Treehouse',
        city: 'Florence',
        name: "Splendida Casa sull'Albero",
        star: '***',
    },
    {
        category: 'Camper',
        city: 'Wimberley',
        name: 'Super Cute Retro Airstream',
        star: '*****',
    },
    {
        category: 'Room',
        city: 'Casablanca',
        name: 'Green Oasis Bougainvillea in Casa',
        star: '****',
    },
];

class List extends Component {
    constructor(props) {
        super(props)
        this.state = {}
    }

    handleChange(event) {
        console.log(this.state)
    }

    render() {
        console.log(this.state)
        return (
            <section>
                <h1>Homes around the world</h1>
                ({Hotel.map(item => {
                    <div className={style.mainSection}>
                        <div><img src={item.image} /></div>
                    
                    <div>
                        {this.state.Hotel.map (item => (
                            <List name={item.name}/>
                        ))}
                    </div>
                    </div>
                })}
            </section>
        )
    }

}

export default List;
